const { User } = require('../../models/ver1/models');
const bcrypt = require('bcrypt');
const uploadFile = require('../uploadFileMiddleware');

// Create
const addNewDriver = async (req, res) => {
    try {
        await uploadFile(req, res);
        if (req.file == undefined) {
            return res.status(400).json({
                resCode: 400,
                resMessage: 'Upload a file please!'
            });
        }

        let newDriverData = req.body;
        newDriverData.role = 'driver';
        newDriverData.image = req.file.filename;
        if (
            !newDriverData.phone ||
            !newDriverData.password ||
            !newDriverData.email ||
            !newDriverData.firstName ||
            !newDriverData.lastName ||
            !newDriverData.gender ||
            !newDriverData.dob ||
            !newDriverData.image
        ) {
            return res.status(400).json({
                resCode: 400,
                resMessage: 'Missing input value(s).'
            });
        }
        console.log(newDriverData);
        let isEmailExist = await isEmailExisted(newDriverData.email);
        let isPhoneExist = await isPhoneExisted(newDriverData.phone);
        if (isPhoneExist) {
            return res.status(400).json({
                resCode: 400,
                resMessage:
                    'Phone number is already used, please choose another phone number.'
            });
        }
        if (isEmailExist) {
            return res.status(400).json({
                resCode: 400,
                resMessage: 'Email already used, please choose another email.'
            });
        }
        let salt = await bcrypt.genSalt(10);
        let encodedPassword = await bcrypt.hash(newDriverData.password, salt);
        let newDriver = new User({
            phone: newDriverData.phone,
            password: encodedPassword,
            email: newDriverData.email,
            firstName: newDriverData.firstName,
            lastName: newDriverData.lastName,
            gender: newDriverData.gender,
            dob: newDriverData.dob,
            image: newDriverData.image,
            role: newDriverData.role
        });
        let resData = newDriver.dataValues;
        await newDriver.save();
        delete resData.password;
        return res.status(200).json({
            resCode: 200,
            resMessage: 'OK',
            data: resData
        });
    } catch (err) {
        return res.status(500).json({
            resCode: 500,
            resMessage: err
        });
    }
};
// Delete
const deleteDriverById = async (req, res) => {
    try {
        let driver = await User.findOne({
            attributes: {
                exclude: ['password']
            },
            where: {
                id: req.params.userId,
                role: 'driver'
            },
            raw: true
        });
        if (!driver) {
            return res.status(404).json({
                resCode: 404,
                resMessage: 'User not found.'
            });
        }
        await User.destroy({
            where: {
                id: req.params.userId,
                role: 'driver'
            },
            raw: true
        });
        return res.status(200).json({
            resCode: 200,
            resMessage: 'OK',
            data: driver
        });
    } catch (err) {
        res.status(500).json({
            resCode: 500,
            resMessage: err
        });
    }
};
// Update
const updateDriverById = async (req, res) => {
    try {
        let driver = await User.findOne({
            attributes: {
                exclude: ['password']
            },
            where: {
                id: req.params.userId,
                role: 'driver'
            },
            raw: true
        });
        if (!driver) {
            return res.status(404).json({
                resCode: 404,
                resMessage: 'User not found.'
            });
        }
        await uploadFile(req, res);
        let newDriverData = req.body;
        if (req.file == undefined) {
            newDriverData.image = driver.image;
        } else {
            newDriverData.image = req.file.filename;
        }
        if (
            !newDriverData.password ||
            !newDriverData.email ||
            !newDriverData.firstName ||
            !newDriverData.lastName ||
            !newDriverData.gender ||
            !newDriverData.dob
        ) {
            return res.status(400).json({
                resCode: 400,
                resMessage: 'Missing input value(s).'
            });
        }
        let isEmailExist = await isEmailExisted(newDriverData.email);
        if (isEmailExist && newDriverData.email !== driver.email) {
            return res.status(400).json({
                resCode: 400,
                resMessage: 'Email already used, please choose another email.'
            });
        }
        let salt = await bcrypt.genSalt(10);
        let encodedPassword = await bcrypt.hash(newDriverData.password, salt);
        await User.update(
            {
                password: encodedPassword,
                email: newDriverData.email,
                firstName: newDriverData.firstName,
                lastName: newDriverData.lastName,
                gender: newDriverData.gender,
                dob: newDriverData.dob,
                image: newDriverData.image
            },
            {
                where: {
                    id: req.params.userId,
                    role: 'driver'
                },
                raw: true
            }
        );
        let resData = await User.findOne({
            attributes: {
                exclude: ['password']
            },
            where: {
                id: req.params.userId,
                role: 'driver'
            },
            raw: true
        });
        delete resData.password;
        return res.status(200).json({
            resCode: 200,
            resMessage: 'OK',
            data: resData
        });
    } catch (err) {
        return res.status(500).json({
            resCode: 500,
            resMessage: err
        });
    }
};
// Read
const getAllDriver = async (req, res) => {
    try {
        let drivers = await User.findAll({
            attributes: {
                exclude: ['password']
            },
            where: {
                role: 'driver'
            },
            raw: true
        });
        if (!drivers) {
            return res.status(404).json({
                resCode: 404,
                resMessage: 'User not found.'
            });
        }
        return res.status(200).json({
            resCode: 200,
            resMessage: 'OK',
            data: drivers
        });
    } catch (err) {
        return res.status(500).json({
            resCode: 500,
            resMessage: err
        });
    }
};
const getDriverById = async (req, res) => {
    try {
        let driver = await User.findOne({
            attributes: {
                exclude: ['password']
            },
            where: {
                id: req.params.userId,
                role: 'driver'
            },
            raw: true
        });
        if (!driver) {
            return res.status(404).json({
                resCode: 404,
                resMessage: 'User not found.'
            });
        }
        return res.status(200).json({
            resCode: 200,
            resMessage: 'OK',
            data: driver
        });
    } catch (err) {
        return res.status(500).json({
            resCode: 500,
            resMessage: err
        });
    }
};
