const { DataTypes, Sequelize } = require('sequelize');

const sequelize = new Sequelize('map_ws_dev', 'root', 'S1mple00@', {
    host: 'localhost',
    dialect: 'mysql'
});

const Vehicle = sequelize.define(
    'Vehicle',
    {
        id: {
            type: DataTypes.INTEGER,
            autoIncrement: true,
            primaryKey: true
        },
        latitude: {
            type: DataTypes.DOUBLE
        },
        longitude: {
            type: DataTypes.DOUBLE
        },
        engineHours: {
            type: DataTypes.STRING
        },
        engineId: {
            type: DataTypes.STRING
        },
        engineType: {
            type: DataTypes.STRING
        },
        model: {
            type: DataTypes.STRING
        },
        odometer: {
            type: DataTypes.DOUBLE
        },
        plate: {
            type: DataTypes.STRING
        },
        speed: {
            type: DataTypes.DOUBLE,
            defaultValue: 0
        },
        altitude: {
            type: DataTypes.DOUBLE
        },
        angle: {
            type: DataTypes.DOUBLE
        },
        image: {
            type: DataTypes.STRING
        },
        ignition: {
            type: DataTypes.STRING,
            defaultValue: 'off'
        },
        status: {
            type: DataTypes.STRING
