        vehicleId: {
            type: DataTypes.INTEGER,
            references: {
                model: 'Vehicle',
                key: 'id'
            },
            onUpdate: 'CASCADE',
            onDelete: 'CASCADE'
        }
    },
    {
        tableName: 'VehicleStateLog',
        timestamps: true
