        latitude: {
            type: DataTypes.DOUBLE
        },
        longitude: {
            type: DataTypes.DOUBLE
        },
        address: {
            type: DataTypes.STRING
        },
        heigth: {
            type: DataTypes.DOUBLE
        },
        weight: {
            type: DataTypes.DOUBLE
        },
        maxWeight: {
            type: DataTypes.DOUBLE
        },
        image: {
            type: DataTypes.STRING
        },
        status: {
            type: DataTypes.STRING
        },
        areaId: {
            type: DataTypes.INTEGER,
            references: {
                model: 'Area',
                key: 'id'
            },
            onUpdate: 'CASCADE',
            onDelete: 'CASCADE'
        }
    },
    {
        tableName: 'Bin',
        timestamps: true
    }
);

const BinStateLog = sequelize.define(
    'BinStateLog',
    {
        id: {
            type: DataTypes.INTEGER,
            autoIncrement: true,
            primaryKey: true
        },
        latitude: {
            type: DataTypes.DOUBLE
        },
        longitude: {
            type: DataTypes.DOUBLE
        },
        weight: {
            type: DataTypes.DOUBLE
        },
        description: {
            type: DataTypes.STRING
        },
        status: {
            type: DataTypes.STRING
        },
        binId: {
            type: DataTypes.INTEGER,
            references: {
                model: 'Bin',
                key: 'id'
            },
            onUpdate: 'CASCADE',
            onDelete: 'CASCADE'
        }
    },
    {
        tableName: 'BinStateLog',
        timestamps: true
    }
);

const Task = sequelize.define(
    'Task',
    {
        id: {
            type: DataTypes.INTEGER,
            autoIncrement: true,
            primaryKey: true
        },
        userId: {
            type: DataTypes.INTEGER,
            references: {
                model: 'User',
                key: 'id'
            },
            onUpdate: 'CASCADE',
            onDelete: 'CASCADE'
        },
        vehicleId: {
            type: DataTypes.INTEGER,
            references: {
                model: 'Vehicle',
                key: 'id'
            },
            onUpdate: 'CASCADE',
            onDelete: 'CASCADE'
        },
        areaId: {
            type: DataTypes.INTEGER,
            references: {
                model: 'Area',
                key: 'id'
            },
            onUpdate: 'CASCADE',
            onDelete: 'CASCADE'
        },
        status: {
            type: DataTypes.STRING
        }
    },
    {
        tableName: 'Task',
        timestamps: true
    }
);

async function createDB() {
    await sequelize.sync({ force: true });
    console.log('All models were synchronized successfully.');
}

module.exports = {
    createDB,
    Vehicle,
    VehicleStateLog,
    User,
    Area,
    Bin,
    BinStateLog,
    Task
};

